import React from 'react';
import banner from './images/banner.JPG';
const MenuImg = React.lazy(() => import('./MenuImg'));



function MenuImgs() {
  return (
    <div className="menuImgs">
        <div className="menuDivRow">
          <div className="menuDivImg">
            <section>
                <MenuImg/>
            </section>
          </div>
        </div>
      </div>
  );
}

export default MenuImgs;
